import React from "react";
import {Card} from "react-bootstrap";
// import axios from "axios";
import "./individualProjects.css";

const IndividualProjects = (props) => {
return (
  <div> 
    <br/>
  <h4>  Individual Projects </h4>
  <Card className = "" style={{ width: "20rem" }}>
  <Card.Body>
  <Card.Title>{props.IndivProjectTitle}</Card.Title>
  <Card.Subtitle className="mb-2 text-muted">{props.IndivProjectInfo}</Card.Subtitle>
  <Card.Link href= {props.IndivProjectGit} ></Card.Link>
  <Card.Link href= {props.IndivProjectLink} ></Card.Link>
  </Card.Body>
  </Card>
  </div>
)
}

export default IndividualProjects;
